import { useContext } from 'react';
import { useHistory } from 'react-router-dom';
import { AppContext } from './context/appContext';

export const ResultsProfile = () => {
    const {
        getPlaylistTracks,
        playlistTracks,
        found
    } = useContext(AppContext)

    let history = useHistory()

    const mappedTracks = playlistTracks.items && playlistTracks.items.map(item =>
        <>
            <p className='list-item list-decimal list-inside'> {item.track.name} </p>
        </>
        )

    // ** for testing **
    // useEffect(() => {
    //     getPlaylistTracks()
    // },[])

    return(
        <div className='container-main'>
            <button onClick={() => history.goBack()} className='btnbold-small bg-cerise-700 text-sm mb-9'> go back </button>
            <div className='container-main mb-0 h-screen bg-navy-700 rounded'>
                <a className='text-4xl' href={`https://open.spotify.com/playlist/${found.id}`}> {found.name} </a>
                {mappedTracks}
            </div>
        </div>
    )
}
